pragma solidity ^0.8.26;

import "contracts/blackjack_interface.sol";


contract Blackjack is BlackjackInterface { 
    uint256 someNumber = 7;
    bool gameStarted = false;
    bool isHit;
    bool isPlayer;
    uint bet = 0;

